import React, { Component } from 'react'
import logo from "../Constant/logo.svg";
import { Link, NavLink } from "react-router-dom";
import { withStyles } from '@material-ui/core/styles';

// Define Styles here ↓
const styles = {

};

function NavBar(props) {

  return (
    <nav className="navbar">

      <div className="navbar-container">

        {/* Logo */}
        <Link to="/" className="navbar-logoContainer">
          <img src={logo} />
        </Link>

        {/* Main Tabs/Routes */}
        <div className="navbar-tabContainer">
          <NavLink exact activeClassName="active-link" to="/"><span>UX Projects</span></NavLink>
          <NavLink exact activeClassName="active-link" to="/projectDetail/:projectId"><span>Open Design</span></NavLink>
          <NavLink exact activeClassName="active-link" to="/about"><span>About</span></NavLink>
        </div>

        {/* Secondary Tabs/Routes */}
        <div className="navbar-tabContainer">
          {/* <li><a><span>Coorporation</span></a></li> */}
          <Link><span>中文</span></Link>
        </div>

      </div>
    </nav>
  );
};

export default withStyles(styles)(NavBar);
